import { onAuthStateChanged } from 'firebase/auth';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { useNavigate } from 'react-router-dom';
import { getAuth } from "firebase/auth";

const auth = getAuth();
const user = auth.currentUser

export default function NavBar(){
    const navigate=useNavigate();
    return (
        <Navbar style={{backgroundColor:'#1D1B26',fontFamily:'sans-serif',fontWeight:500}} sticky='top' className='Navbar'>
            <Nav>
                <Nav.Link style={{color:'white'}} onClick={()=>{
                    if (auth.currentUser){
                        console.log(auth.currentUser)
                        navigate('/db')
                    }
                    else {
                        console.log('no auth detected')
                        navigate('/signIn')
                    }
                    //Auth.login(()=>navigate('/db'))
                    }}>View Properties</Nav.Link>
                {auth.currentUser?(
                    <Nav.Link style={{color:'white'}} onClick={()=>{navigate('/signIn',{userLoggedIn:auth})}}>Sign Out</Nav.Link>
                ):(
                    <Nav.Link style={{color:'white'}} onClick={()=>{navigate('/signIn',{userLoggedIn:null})}}>Sign In</Nav.Link>
                )}
            </Nav>
        </Navbar>
    )
}
